const Example = () => {
  const cliclHandler = () => {
    alert("ボタンがクリックされました");
  };
  const cliclHandler2 = () => {
    alert("ボタンがクリックされました");
  };
  return (
    <>
      <button
        onClick={() => {
          alert("ボタンがクリックされました");
        }}
      >
        クリックしてね
      </button>
      <button onClick={cliclHandler2}>クリックしてね</button>
    </>
  );
};

export default Example;
